import React from 'react';
import './Country.css';

export default function CountryCard(name, iso2, continent) {
  return (
    <>
      <div className="name">{name}</div>
      <div className="name">{iso2}</div>
      <div className="name">{continent}</div>
      <img></img>
    </>
  );
}
